import React from "react";
import style from "./NavBar.module.css";

function NavBar() {
  return (
    <nav className={style.nav}>
      <ul>
        <li className={style.li}><a href=".#">My Server</a> </li>
        <li className={style.active}><a href=".#">Recommended</a> </li>
        <li className={style.li}><a href=".#">NA Server</a> </li>
      </ul>
    </nav>
  );
}

export default NavBar;
